from SeisPolPy import Flinn , Pinnegar# Rstfr, Vidale
import mat4py
import numpy as np


data = mat4py.loadmat('tests/ACRG.mat') # seismic data
sig = np.array([data['t'], data['r'], data['z']])

def test_flinn():
    assert Flinn.flinn(sig, 50) == '...'

def test_Pinnegar():
    assert Pinnegar.pinnegar(sig) == '...'
